          method: 'GET',
          body:body,
          headers:{'Content-Type': 'application/json'}
      }).then((response) => {
          if (!response.ok) {
            console.log('response error!');
            return false;
          } else {
            console.log('response good!');
            return response.json();
          }
      }).then((data)  => {
        const id = data.id
        console.log(data)
        this.setState({
          name: data.name,
      email: data.email,
      id: data.id,
      })
    }).catch((error) => {
          console.log(error);
          return false;
      })
    }
  render() {
    return (
      <Container>
        <div>
          <h2>Hello Login app mypage</h2>
          <p>名前{this.state.name}</p>
          <div>
            <Link to="/logout">Logout</Link>
          </div>
        </div>
      </Container>
    );
  }
}
